INSERT INTO poefficiencymeasure VALUES (7,'Usage of heat exchanger','Install heat exchangers to recover thermal energy from condensate in its bottle washing section and fuel oil heater condensate'),(8,'Cascaded use of wash water ','Cascaded use of wash water '),(9,'Low temperature detergents','Low temperature detergents in washing: Use of final rinsing water for pre-rinsing, intermediate rinsing or the preparation of cleaning solution (often used in CIP systems); turbidity detectors can optimize the reuse of water'),(10,'Reuse pasteurizing overflow water','Reuse pasteurizing overflow water'),(11,'Use store heat / solar heat','Use store heat / solar heat for heating system for start up'),(12,'Preheat incoming containers','Preheat incoming containers (ambient air, solar)'),(13,'Local generation of hot water','Local generation of hot water\n'),(14,'Use of hot water instead of steam ','Use of hot water instead of steam (no distribution losses, no HEX losses etc.)\n\n'),(15,'Insulating high temperature zones of unit','Insulating high temperature zones of unit\n'),(16,'Thinner glass / more conductive materials','Thinner glass / more conductive materials lower the driving temperature (temp drop across glass now: 5-15°C)\n'),(17,'Even heating/cooling','Even heating/cooling increase heat transfer and shorten process times\n'),(18,'Immersion, spraying from below another heat transfer systems','Immersion, spraying from below, or other heat transfer systems may increase internal convection and allow process time to be shorter\n'),(19,'Little temperature increase of containers leaving the unit','Aiming at very little temperature increase of containers leaving the unit (normally +20°C compared to entrance temp)\n'),(20,'Usage of waste heat','Evaporatively cooled water, absorption or ejector cooling with waste heat or other strategies may be used for cooling, if necessary\n\n'),(21,'Reuse pasteurizing overflow water','Reuse pasteurizing overflow water\n'),(22,'Conjunction with heat recovery ','Possible use in conjunction with heat recovery or at variable basis to achieve specified temperatures where variable heat sources are available or flow rates vary. Efficiency at 90% (conversion from electricity). Power from cogeneration can enhance economic/ecological performance.\n'),(23,'Reducing pressure drop over filters','Reducing pressure drop over filters is decisive. Strategies using centrifuges\n\n'),(24,'Use of vapour condensers in wort boiling','Use of vapour condensers in wort boiling to collect hot water from condensate \n\n\n'),(25,'Capture of waste energy from mashing','Capture of waste energy from mashing\n\n\n\n'),(26,'Use of compession filter in mashing','Use of compession filter in mashing\n\n\n\n\n'),(27,'Install heat recovery cellars to reduce refrigeration loss ','Install heat recovery cellars to reduce refrigeration loss \n\n\n\n\n\n'),(28,'Install a system to recover CO2 from the fermentation ','Install a system to recover CO2 from the fermentation for the later use in carbonation process\n\n\n\n\n\n\n'),(29,'Heat recovery from wort cooling','Use of spent cooling water from wort cooling as process water for the next mash\n\n\n\n\n\n\n\n'),(32,'Closed smoking and cooking operation','Reduction of energy demand in closed smoking/cooking compared to open system\n\n\n\n\n\n'),(33,'Drying with low air flow','500-600m3/h air flow in drying is common in most modern chambers \n\n\n\n\n\n\n'),(31,'Dew point regulation for cooling process','Reduction of air ventilation to the necessary minimum for an efficient process increases the operation efficiency (less excess air), saving potential up to 5%\n\n\n\n\n\n\n\n\n'),(34,'Use of waste heat of cooling machines and compressors','High potential if a low temperature demand exists\n\n\n\n\n\n\n\n'),(35,'Thawing in air ','Thawing in air \n\n\n\n\n\n\n\n\n'),(36,'Gas motor driven cooling machines','Gas motor driven cooling machines\n\n\n\n\n\n\n\n\n\n'),(37,'Absorbtion cooling with waste heat','Absorbtion cooling with waste heat (from a CHP plant)\n\n\n\n\n\n\n\n\n\n\n'),(38,'Dew point regulation for drying process','Reduction of drying air to the necessary minimum for an efficient process increases the operation efficiency (less excess air); saving potential up to 5%\n\n\n\n\n\n\n\n\n\n\n\n'),(39,'Fermenter: heat exchange between cold milk and hot whey','This heat exchanger is in modern plants state of the art and can save a large amount of energy demand for milk heating \n\n\n\n\n\n\n\n\n\n\n\n\n'),(40,'Reverse osmosis/filtration prior to thermal evaporation techniques (such as vapour compression)','A mechanical concentration step of the whey reduces necessary thermal energy demang (or electrial for mechanical vapour compression) in the subsequent process step. \n\n\n\n\n\n\n\n\n\n\n\n\n'),(41,'Reuse of waste condensate streams','Reuse of waste condensate streams either directly if possible (in the lye of the CIP system) or via heat exchanger for heating process water (wash water in fementation, manual cleaning water etc.)\n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(42,'Use of waste heat streams from washing processes','Use of waste heat streams from washing processes e.g. vapours of sterilization processes for water pre-heating, use of heat from the spray lye in the main lye bath in bucket washing system. \n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(43,'Use of waste heat from cooling machines and compressors','High potential if a low temperature heat demand exists\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(44,'Homogenisation a branch current','Homogenising only one branch of the total process streams can save up to 60% of energy. Applied for milk and cream homogenisation.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(45,'Closed, self cleaning seperators of cream','Combined closed systems for taking out the cream and cleaning\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(46,'Ohmic heating using the product as resistance','Ohmic heating using the product as resistance\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n'),(74,'UHT treatment for milk sterilization','Indirect units, where no direct contact between steam and milk is established, can recover more waste heat (88-90%) than direct operation modes (44-50%)\n'),(51,'Off peak cooling and night over-chilling','Reduction of energy costs through re-arrangement of cooling hours\n\n\n\n'),(52,'Pre-cooling grapes with chilled water','Pre-cooling grapes prior to must chilling reduces peak load on the refrigeration plant\n\n\n\n'),(53,'Evaporative cooling or chilled water to control fermentation','Fermentation could be controlled by chilled water at 4-6°C; evaporative condensers can also provide low enough temperatures to prevent wild fermentation prior to controlled fermentation.\n\n\n\n\n'),(54,'Thermal storage','During night temperature could be pulled down to the allowable band, decreasing daytime refrigeration demand by allowing wine temperature to rise to the top of the allowable band by the late afternoon. Advantage: running at lower temperature during the night enhances condenser efficiency.\n\n\n\n\n'),(58,'Centrifuge driven separation methods',' Replacing cold settling by mechanical alternatives such as centrifuge driven separation methods can significantly reduce the load on the refrigeration plant.\n\n\n'),(57,'product-product heat exchange','Large wineries practice heat exchange into and out of cold vessels - especially vauable when advoiding switch in another compressor to handle cold stabilisation - heat recovery efficiency ~80%. Larger volumes improve effectiveness of heat exchange\n\n\n'),(59,'Heating of juice using solar hot water','Use of solar heat (in combination with waste heat from compressors) for heating juice imported to site from tankers\n\n\n\n'),(60,'Cross flow filters instead of centrifuge','Stainless steel and titanium metallic membranes are robust and have self cleaning properties; final separation can be done via decanters or belt press. Energy savings compared to centrifuges up to 50%.\n\n\n\n'),(61,'Internal recycling of water and chemicals','Internal recycling of water and chemicals\n\n\n\n\n'),(62,'Dry cleaning','Dry cleaning prior to wet cleaning saves water and energy costs\n\n\n\n\n\n'),(63,'Catchpots','Catchpots prevent solid material entering the waste water flow while cleaning, reduced water contamination\n\n\n\n\n\n\n'),(64,'Pre-soaking','Loosen the dirt and subsequent easier cleaning; reduced water and energy demand\n\n\n\n\n\n\n\n'),(65,'Using metered water dispensers and/or high pressure low volume (HPLV) sprays for cleaning trucks','Used in the wine industry: leads to reduced water consumption for truck cleaning\n\n\n\n\n\n\n\n'),(66,'Volume based control on rinsing in CIP systems','Volume based control can save more energy than time based control system\n\n\n\n\n\n\n'),(67,'Nozzle optimisation and maintainance','Nozzle optimisation and maintainance\n\n\n\n\n\n\n'),(68,'Pre-soaking','Floors and other equipment can be pre-soaked to loosen hardened of burnt-on dirt befor wet cleaning\n\n\n\n\n\n'),(69,'Vapour recompression','Additional energy can be saved by recompressing the vapour using a thermal vapour recompressor (TVR) or a mechanical vapour recompressor (MVR).\n\n\n\n\n'),(70,'Regular cleaning','During processing, product compounds gradually deposit on the heat-exchange surfaces. This can affect the efficiency of the heat-exchange and lead to heat losses in the system. These deposits may be inorganic or organic, depending on the product. The installation must, therefore, be cleaned at regular intervals to prevent too high a heat loss occurring with a subsequent loss of product quality\n\n\n\n\n\n'),(71,'High efficiency pumps','High efficiency pumps, VS drives'),(72,'Mechanical vapour compression for evaporation in whey drying','Mechanical vapour compression is now seen as best available, as it further reduces energy, especially themal energy consumption. The reduction reaches a demand that is only 1/5 of the primary energy demand for thermal vapour compression. \n'),(73,'Thermal multi-stage vapour compression for evaporation in whey drying','Generally in multistage compression system reduces steam demand considerable (1 stage - 100%, 2 stage = 33%). \n\n');
UNLOCK TABLES;
/*!40000 ALTER TABLE poefficiencymeasure ENABLE KEYS */;

